import{_ as a,c as t,a5 as r,o as i}from"./chunks/framework.BgPEmfgH.js";const g=JSON.parse('{"title":"Squad Speedruns","description":"","frontmatter":{},"headers":[],"relativePath":"advanced/squad-speedruns.md","filePath":"advanced/squad-speedruns.md","lastUpdated":null}'),o={name:"advanced/squad-speedruns.md"};function s(n,e,l,d,u,h){return i(),t("div",null,e[0]||(e[0]=[r('<h1 id="squad-speedruns" tabindex="-1"><strong>Squad Speedruns</strong> <a class="header-anchor" href="#squad-speedruns" aria-label="Permalink to &quot;**Squad Speedruns**&quot;">​</a></h1><h2 id="roles" tabindex="-1"><strong>Roles</strong> <a class="header-anchor" href="#roles" aria-label="Permalink to &quot;**Roles**&quot;">​</a></h2><p><em>Squad strats aren’t fully optimized yet, there are still debatable choices. If you’re interested in finding new strats or wanna run with other people, we welcome you to join <a href="https://discord.profit-taker.com" target="_blank" rel="noreferrer"><strong>our discord server</strong></a></em></p><p>A coordinated PT squad needs to focus on a few different things for a squad run to make good use of the additional manpower.</p><p>Generally, squads make use of at least one Archgunner, meaning one player who arrives at the orb and calls down a heavy weapon (or does an archlanding / uses Nova). The main reason for this is that an archgun in heavy weapon mode can receive warframe buffs like Eclipse, Roar or Wisp’s Haste Motes, allowing you to run a weapon with higher fire rate and lower damage to break legs faster. Since a dedicated archgunner can stay in archgun mode throughout the entire fight, it&#39;s possible to make full use of the advantages that heavy weapon archguns have over necramech archguns. Imperator Vandal (fell out of favor due to <a href="/miscellaneous/bugs.html#archgun-hitbox-bug"><strong>archgun hitbox bug</strong></a>) is usually the archgun of choice, since it has the highest fire rate.</p><h3 id="volt" tabindex="-1"><strong>Volt</strong> <a class="header-anchor" href="#volt" aria-label="Permalink to &quot;**Volt**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="https://cdn.profit-taker.com/voltbuild.png" alt="voltbuild" style="width:100%;height:auto;"></div><div class="info custom-block"><p class="custom-block-title"><a href="https://overframe.gg/build/396847/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Volt provides essential speed buffs and damage amplification.</li><li>He runs Eclipse and deploys shields to increase squad damage by a lot.</li><li>Runs the same build as in solo, Total Eclipse can be removed for more str.</li></ul></div><h3 id="mirage" tabindex="-1"><strong>Mirage</strong> <a class="header-anchor" href="#mirage" aria-label="Permalink to &quot;**Mirage**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="https://cdn.profit-taker.com/miragebuild.png" alt="miragebuild" style="width:100%;height:auto;"></div><div class="info custom-block"><p class="custom-block-title"><a href="https://overframe.gg/build/626559/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Mirage&#39;s clones significantly boost Archgun damage output.</li><li>Duration is tweaked to make one cast of Eclipse last the entire fight.</li><li>Shooting Gallery subsume for some extra damage without replacing Eclipse</li><li>Can also be utilized for Pylons after Eclipse nerf, as Mirage retains the original Eclipse strength and can still oneshot Pylons. If 2 Mirages are used, one can subsume Roar.</li></ul></div><h3 id="chroma" tabindex="-1"><strong>Chroma</strong> <a class="header-anchor" href="#chroma" aria-label="Permalink to &quot;**Chroma**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="https://cdn.profit-taker.com/chromabuild.png" alt="chromabuild" style="width:100%;height:auto;"></div><div class="info custom-block"><p class="custom-block-title"><a href="https://overframe.gg/build/626562/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Chroma offers unique utility with damage buffs (including toxin Elemental Ward) and credit doubling abilities.</li><li>Power Donation aura to buff the squad and fit the mod polarity</li></ul></div><h3 id="wisp" tabindex="-1"><strong>Wisp</strong> <a class="header-anchor" href="#wisp" aria-label="Permalink to &quot;**Wisp**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="https://cdn.profit-taker.com/wispbuild.png" alt="wispbuild" style="width:100%;height:auto;"></div><div class="info custom-block"><p class="custom-block-title"><a href="https://overframe.gg/build/626566/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Wisp increases fire rate and flight speed, enhancing shield and leg performance.</li><li>She can run Roar or Empower based on if an additional pylon Mirage is used.</li><li>Piercing Roar is used to make sure everyone gets the buff.</li><li>Wisp can put down Reservoirs right after leaving elevator with enough casting speed (shards) to speed up the flight further</li></ul></div><h3 id="nova" tabindex="-1"><strong>Nova</strong> <a class="header-anchor" href="#nova" aria-label="Permalink to &quot;**Nova**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="https://cdn.profit-taker.com/novabuild.png" alt="novabuild" style="width:100%;height:auto;"></div><div class="info custom-block"><p class="custom-block-title"><a href="https://overframe.gg/build/626700/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><ul><li>Nova&#39;s portals enable her to teleport to Profit Taker’s spawn with an archgun in hand</li><li>She&#39;s best suited for lake spawn and must be the host to be viable.</li><li>See demonstration in <a href="/advanced/untapped-potential"><strong>untapped potential</strong></a></li></ul></div><h2 id="subsumes" tabindex="-1"><strong>Subsumes</strong> <a class="header-anchor" href="#subsumes" aria-label="Permalink to &quot;**Subsumes**&quot;">​</a></h2><ul><li>Subsumed abilities augment squad performance, often focusing on maximizing damage output.</li><li>Common combinations include Eclipse on Volt and Roar on Archgunner.</li><li>Other options include Empower on Wisp, toxin Elemental Ward, or Shooting Gallery.</li></ul><h2 id="archguns" tabindex="-1"><strong>Archguns</strong> <a class="header-anchor" href="#archguns" aria-label="Permalink to &quot;**Archguns**&quot;">​</a></h2><h3 id="build-all-archguns" tabindex="-1"><strong>Build - all Archguns</strong> <a class="header-anchor" href="#build-all-archguns" aria-label="Permalink to &quot;**Build - all Archguns**&quot;">​</a></h3><div style="width:100%;text-align:left;"><img src="https://cdn.profit-taker.com/imperatorbuild.png" alt="imperatorbuild" style="width:100%;height:auto;"></div><p><a href="https://overframe.gg/build/705998/" target="_blank" rel="noreferrer"><em><strong>Overframe Link</strong></em></a></p><div style="width:25%;text-align:left;"><img src="https://cdn.profit-taker.com/imperatorriven.png" alt="imperatorriven" style="width:100%;height:auto;"></div><h2 id="squad-pylons" tabindex="-1"><strong>Squad Pylons</strong> <a class="header-anchor" href="#squad-pylons" aria-label="Permalink to &quot;**Squad Pylons**&quot;">​</a></h2><p><strong>This section discusses strategies for targeting pylons as a squad and is now defunct due to Pogris. You can still see it in older versions of the guide that you can find <a href="/miscellaneous/resources-used-honorable-mentions.html"><strong>here</strong></a>.</strong></p>',29)]))}const m=a(o,[["render",s]]);export{g as __pageData,m as default};
